import Contact from './comps/Contact'
import Home from './comps/Home'
import Work from './comps/Work'
import './index.css'

function App() {
  return (
    <>
    <div class="bg-primary">
        <Home />
        <Work />
        <Contact />
    </div>
    </>
  );
}

export default App;
